  true,\n\t\"url\": null,\n\t\"notes\": \"<p>One of the clear goals of the Childrens
  Health Insurance Program Reauthorization Act of 2009 is to support states in developing
  efficient and effective strategies to identify, enroll, and retain health coverage
  for uninsured children who are eligible for Medicaid or CHIP, but are not enrolled.
  CHIPRA also provided flexibility to states to expand health care coverage to children
  who need it, and tasked the Secretary of Health and Human Services (HHS) with developing
  standards by which states can measure the quality of the care that children are
  receiving. This Web page provides links to data about the uninsured rate among children,
  gaps in coverage for children, and surveys about enrollment.</p>n\",\n\t\"license_title\":
